arguments.schema:
{
    "$id": "#IMember",
    "type": "object",
    "properties": {
        "id": {
            "type": "string",
            "format": "uuid",
            "title": "Member ID",
            "description": "Unique identifier of the member"
        },
        "name": {
            "type": "string",
            "title": "Member Name",
            "description": "Full name of the member"
        },
        "email": {
            "type": "string",
            "format": "email",
            "title": "Email Address",
            "description": "Contact email address of the member"
        },
        "age": {
            "type": "number",
            "minimum": 20,
            "exclusiveMaximum": 100,
            "title": "Age",
            "description": "Age of the member (must be between 20 and 100)"
        },
        "hobbies": {
            "type": "array",
            "items": {
                "type": "object",
                "properties": {
                    "id": {
                        "type": "string",
                        "format": "uuid",
                        "title": "Hobby ID",
                        "description": "Unique identifier of the hobby"
                    },
                    "name": {
                        "type": "string",
                        "title": "Hobby Name",
                        "description": "Name of the hobby"
                    }
                },
                "required": ["id", "name"],
                "title": "Hobby",
                "description": "A hobby of the member"
            },
            "title": "Hobbies",
            "description": "List of member's hobbies"
        },
        "created_at": {
            "type": "string",
            "format": "date-time",
            "title": "Created At",
            "description": "Timestamp when the member was created"
        },
        "updated_at": {
            "type": "string",
            "format": "date-time",
            "title": "Updated At",
            "description": "Timestamp when the member was last updated"
        },
        "deleted_at": {
            "oneOf": [
                {
                    "type": "null",
                    "title": "Not Deleted",
                    "description": "Indicates the member is not deleted"
                },
                {
                    "type": "string",
                    "format": "date-time",
                    "title": "Deletion Time",
                    "description": "Timestamp when the member was deleted"
                }
            ],
            "title": "Deleted At",
            "description": "Timestamp when the member was deleted, or null if not deleted"
        }
    },
    "required": ["id", "name", "email", "age", "hobbies", "created_at", "updated_at", "deleted_at"],
    "title": "Member",
    "description": "Represents a member with their basic information and hobbies"
}

